import * as React from 'react';
import Backdrop from '@mui/material/Backdrop';
import Modal from '@mui/material/Modal';
import { BoxModal, ButtonAddToCart, SelectQuantity, TitleModal } from './styled';


export default function ModalQuantity({open, setOpen}) {

  return (
    <div>
      <Modal
        open={open}
        onClose={() => setOpen(false)}
        closeAfterTransition
        BackdropProps={{
          timeout: 500,
        }}
      >
          <BoxModal>
           <TitleModal>
            Selecione a quantidade desejada
           </TitleModal>
           <SelectQuantity>
            <option>1</option>
            <option>2</option>
            <option>3</option>
            <option>4</option>
            <option>5</option>
            <option>6</option>
            <option>7</option>
            <option>8</option>
            <option>9</option>
            <option>10</option>
           </SelectQuantity>
           <ButtonAddToCart>Adicionar ao carrinho</ButtonAddToCart>
          </BoxModal>
      </Modal>
    </div>
  );
}
